import React from 'react'

const Online = () => {
    return (
        <div className="onlineFriendContainer">
            <div className="onlineUsers">
                <div className="onlineSign"></div>
                <img src="/assets/images/profile1.jpg" alt="" className="onlineUserImage" />
                <p className="onlineUserName">Safeer</p>
            </div>
        </div>
    )
}

export default Online
